css:
@-moz-document url-prefix("https://news.google"), url-prefix("http://news.google") {
/* Globals */
/* Style by Rick A - @Rickscloud - with credit to http://userstyles.org/users/50126 under creative commons license*/
/* Logo & Header */

* {
    color: #000000;
}
div#page-header {
    background: transparent !important;
}
div#page-header img {
    display: none !important;
}
div#page-header table tbody tr td {
    background: url(data:image/png;base64,) no-repeat !important;
    width: 160px;
    padding-top: 5px !important;
}
img.jfk-button-img {
    display: none !important;
}
div#settings-button {
    background: url(data:image/png;base64,) no-repeat !important;
}
div#gbx1,
div.kd-appbar {
    background: #d3d3d3 !important;
}
div.kd-appbar {
    border-bottom: 1px solid #57575F !important;
}
div#page-header table tbody tr td.search-in-header {
    background: none !important;
}
div.main-appbar div,
div.main-appbar div input {
    color: #333 !important;
}
div.background {
    background: url('http://imgur.com/6kXsWvL') #d3d3d3 no-repeat fixed 165px;
}
/* Left Nav */

span.sel {
    color: #2277DD !important;
}
a.persistentblue {
    color: #000000 !important;
    font-family: Calibri !important;
    font-size: 10pt;
}
div.left-nav-pinned,
div#left-nav-wrapper,
div.nav-one-col-hp {
    background: #d3d3d3 !important;
    border-right: 1px solid #57575F;
}
/* Main Content */

div.main-content-with-gutter-wrapper {
    border-left: 1px solid #222;
}
div.basic-title {
    background: transparent !important;
    color: #000000;
    font-size: 12pt !important;
    border-bottom: 1px solid #DDD;
}
div.basic-title a {
    color: #000000 !important;
    text-decoration: none !important;
}
div.blended-wrapper,
div.blended-wrapper-first,
div.story {
    background: transparent !important;
}
span.titletext {
    color: #000000;
    font-size: 12pt !important;
    font-weight: bold !important;
    text-decoration: none !important;
}
div.snippet {
    color: #000000;
    font-size: 10pt !important;
}
div.story a {
    color: #000000 !important;
    font-size: 11pt;
}
div.story span.date {
    color: #d3d3d3 !important;
}
div.story {
    font-family: Calibri !important;
}
div.story div.thumbnail a img {
    outline: none !important;
    border: none !important;
    box-shadow: 0px 0px 5px #333;
}
/* Main Content - Personalize section */

div#eqp-pane-wrapper,
div.eqp-pane-inner,
div.topic-autocomplete-wrapper,
div.select-source-autocomplete-wrapper {
    background: #d3d3d3 !important;
}
table.topic-list-row,
table.suggest-topic-list-row {
    border: none !important;
}
div#list-separator {
    display: none !important;
}
/* Footer */

div.footer {
    background: #d3d3d3 !important;
}
}
